INSERT INTO `TAG_TAG` (`TAG_ID`, `TAG_NS`, `TAG_PARENT_TAG_ID`, `TAG_NAME`, `TAG_BODY`) VALUES (1,'/oy/math',0,'fraction','Any number that does not represent a whole is called a \"fraction\". A fraction can be represented as one number divided by another non-zero number.'),(2,'/oy/math',0,'power','An exponent of a number, such as in X<sup>n</sup>.'),(3,'/oy/math',0,'addition',NULL),(4,'/oy/math',0,'substraction',NULL),(5,'/oy/math',0,'multiplication',NULL),(6,'/oy/math',0,'division',NULL),(7,'/oy/math',0,'decimal fraction','A decimal fraction is a fraction where the denominator is a power of ten. Decimal fractions are commonly expressed without a denominator, the decimal separator (comma) being inserted into the numerator at the appropriate position. For example: 5.25 is a decimal fraction or a decimal.'),(8,'/oy/math',0,'percent',NULL),(9,'/oy/math',0,'prime numbers','A natural number\r\n<i>p</i>\r\ngreater than 1 is prime if and only if the only positive\r\ninteger factors of\r\n<i>p</i>\r\nare 1 and\r\n<i>p</i>\r\n. The first seven primes are 2, 3, 5, 7, 11, 13, 17.'),(10,'/oy/math',0,'absolute value','A number’s distance from zero on the number line. The absolute value of -4 is 4; the absolute value of 4 is 4.'),(11,'/oy/math',0,'complex number','Numbers that have the form\r\n<i>a</i>\r\n+\r\n<i>bi</i>\r\nwhere\r\n<i>a</i>\r\nand\r\n<i>b</i>\r\nare real numbers and\r\n<i>i</i>\r\nsatisfies the equation\r\n<i>i</i>\r\n\r\n<sup>2</sup>\r\n<i>=</i>\r\n-1. Multiplication is denoted by (\r\n<i>a+bi</i>\r\n)(\r\n<i>c+di</i>\r\n)\r\n<i>=</i>\r\n(\r\n<i>ac</i>\r\n<font face=\'Symbol\'>&#8722;</font>\r\n<i>bd</i>\r\n)\r\n<i>+</i>\r\n(\r\n<i>ad+bc</i>\r\n)\r\n<i>i</i>\r\n, and addition is denoted by (\r\n<i>a+bi</i>\r\n)\r\n<i>+</i>\r\n(\r\n<i>c + di</i>\r\n)\r\n<i>=</i>\r\n(\r\n<i>a+c</i>\r\n)\r\n<i>+</i>\r\n(\r\n<i>b+d</i>\r\n)\r\n<i>i.</i>'),(12,'/oy/math',0,'coordinate system','A rule of correspondence by which two or more quantities\r\nlocate points unambiguously and which satisfies the further\r\nproperty that points unambiguously determine the quantities;\r\nfor example, the usual Cartesian coordinates\r\n<i>x, y</i>\r\nin the plane.'),(13,'/oy/math',0,'expanded form','The expanded form of an algebraic expression is the <i>equivalent expression</i> without parentheses. For example, the expanded form of (<i>a + b</i>)<sup>2</sup> is <i>a</i> <sup>2</sup> <i>+</i> 2 <i>ab + b</i><sup>2</sup>.'),(14,'/oy/math',0,'exponent','The expanded form of an algebraic expression is the <i>equivalent expression</i> without parentheses. For example, the expanded form of (<i>a + b</i>)<sup>2</sup> is <i>a</i><sup>2</sup> <i>+</i> 2 <i>ab + b</i><sup>2</sup>.'),(15,'/oy/math',0,'inequality','A relationship between two quantities indicating that one is strictly <i>less than</i> or <i>less</i> <i>than or equal</i> to the other.'),(16,'/oy/math',0,'irrational number','A number that cannot be represented as an exact ratio of two integers. For example, the square root of 2 or <font face=\'Symbol\'>&#960;</font>.'),(17,'/oy/math',0,'factor','In the expression 3.712 <font face=\'Symbol\'>×</font> 11.315, the factors are 3.712 and 11.315.'),(18,'/oy/math',0,'mean','In statistics, the average obtained by dividing the sum of two or more quantities by the number of these quantities.'),(19,'/oy/math',0,'median','In statistics, the quantity designating the middle value in a set of numbers.'),(20,'/oy/math',0,'root extraction','Finding a number that can be used as a factor a given number\r\nof times to produce the original number; for example, the\r\nfifth root of 32 = 2 because 2\r\n<font face=\'Symbol\'>×</font>\r\n2\r\n<font face=\'Symbol\'>×</font>\r\n2\r\n<font face=\'Symbol\'>×</font>\r\n2\r\n<font face=\'Symbol\'>×</font>\r\n2 = 32).'),(21,'/oy/math',0,'square root','The square roots of <i>n</i> are all the numbers <i>m</i> so that <i>m</i><sup>2</sup>\r\n<i>= n</i>\r\n. The square roots of 16 are 4 and -4. The square\r\nroots of -16 are 4\r\n<i>i</i>\r\nand -4\r\n<i>i.</i>'),(22,'/oy/math',0,'quadratic function','A function given by a polynomial of degree 2.'),(23,'/oy/math',0,'axiom','A basic assumption about a mathematical system from which theorems can be deduced. For example, the system could be the points and lines in the plane. Then an axiom would be that given any two distinct points in the plane, there is a unique line through them.'),(24,'/oy/math',0,'binomial','In algebra, an expression consisting of the sum or difference of two monomials (see the definition of <i>monomial</i> ), such as 4 <i>a</i> - 8<i>b.</i>'),(25,'/oy/math',0,'monomial','In the variables\r\n	<i>x, y, z</i>\r\n	, a monomial is an expression of the form\r\n	<i>ax</i>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>\r\n				<i>m</i>\r\n			</sup>\r\n		</font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			<i>y</i>\r\n		</span>\r\n	</font>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>\r\n				<i>n</i>\r\n			</sup>\r\n		</font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			<i>z</i>\r\n		</span>\r\n	</font>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>\r\n				<i>k</i>\r\n			</sup>\r\n		</font>\r\n		<font face=\'Times\'></font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			<i>,</i>\r\n			in which\r\n			<i>m,</i>\r\n			<i>n,</i>\r\n			and\r\n			<i>k</i>\r\n			are nonnegative integers and\r\n			<i>a</i>\r\n			is a constant (e.g., 5\r\n			<i>x</i>\r\n		</span>\r\n	</font>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>2</sup>\r\n		</font>\r\n		<font face=\'Times\'></font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			, 3\r\n			<i>x</i>\r\n		</span>\r\n	</font>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>2</sup>\r\n		</font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			<i>y</i>\r\n			or 7\r\n			<i>x</i>\r\n		</span>\r\n	</font>\r\n	<span style=\'font-family: Times\'>\r\n		<font face=\'Times New Roman\'>\r\n			<sup>3</sup>\r\n		</font>\r\n	</span>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>\r\n			<i>yz</i>\r\n		</span>\r\n	</font>\r\n	<sup>\r\n		<font face=\'Times New Roman\'>\r\n			<span style=\'font-family: Times\'>2</span>\r\n		</font>\r\n	</sup>\r\n	<font face=\'Times\' size=\'3\'>\r\n		<span style=\'font-family: Times\'>).</span>\r\n	</font>'),(26,'/oy/math',0,'binomial distribution','In probability, a binomial distribution gives the\r\nprobabilities of\r\n<i>k</i>\r\nout­ comes\r\n<i>A</i>\r\n(or\r\n<i>n</i>\r\n<font face=\'Symbol\'>?</font>\r\n<i>k</i>\r\noutcomes\r\n<i>B</i>\r\n) in\r\n<i>n</i>\r\nindependent trials for a two-outcome experiment in which the\r\npossible outcomes are denoted\r\n<i>A</i>\r\nand\r\n<i>B.</i>'),(27,'/oy/math',0,'cosine','Cos(\r\n<font face=\'Symbol\'>&#952;</font>\r\n) is the\r\n<i>x</i>\r\n-coordinate of the point on the unit circle so that the ray\r\nconnecting the point with the origin makes an angle of\r\n<font face=\'Symbol\'>&#952;</font>\r\nwith the positive\r\n<i>x-</i>\r\naxis. When\r\n<font face=\'Symbol\'>&#952;</font>\r\nis an angle of a right triangle, then cos(\r\n<font face=\'Symbol\'>&#952;</font>\r\n) is the ratio of the adjacent side with the hypotenuse.'),(28,'/oy/math',0,'sine','Sin(\r\n<font face=\'Symbol\'>&#952;</font>\r\n) is the\r\n<i>y</i>\r\n-coordinate of the point on the unit circle so that the ray\r\nconnecting the point with the origin makes an angle of\r\n<font face=\'Symbol\'>&#952;</font>\r\nwith the positive\r\n<i>x</i>\r\n-axis. When\r\n<font face=\'Symbol\'>&#952;</font>\r\nis an angle of a right triangle, then\r\n<i>sin</i>\r\n(\r\n<font face=\'Symbol\'>&#952;</font>\r\n) is the ratio of the opposite side with the hypotenuse.'),(29,'/oy/math',0,'integer','The set consisting of the positive and negative whole numbers and zero; for example, {. . . -2, -1, 0, 1, 2 . . .}.'),(30,'/oy/math',0,'polar coordinates','The coordinate system for the plane based on\r\n<i>r</i>\r\n<font face=\'Symbol\'>&#952;</font>\r\n, the distance from the origin and\r\n<font face=\'Symbol\'>&#952;</font>\r\n, and the angle between the positive\r\n<i>x</i>\r\n-axis and the ray from the origin to the point.'),(31,'/oy/math',0,'polynomial','In algebra, a sum of monomials; for example, <i>x</i><sup>2</sup><i>+</i>2<i>xy + y</i><sup>2</sup>.'),(32,'/oy/math',0,'ratio','A comparison expressed as a fraction. For example, there is a ratio of three boys to two girls in a class (3/2, 3:2).'),(33,'/oy/math',0,'rational number','Numbers that can be ex­ pressed as the quotient of two integers; for example, 7/3, 5/11, -5/13, 7 = 7/1.'),(34,'/oy/math',0,'zeros of a function','The points at which the value of a function is zero.'),(35,'/oy/math',0,'vector','Quantity that has magnitude (length) and direction. It may be represented as a directed line segment.'),(36,'/oy/math',0,'system of linear equations','Set of equations of the first degree (e.g.,\r\n<i>x</i>\r\n+\r\n<i>y</i>\r\n= 7 and\r\n<i>x</i>\r\n<font face=\'Symbol\'>&#8722;</font>\r\n<i>y</i>\r\n= 1). A solution of a set of linear equations is a set of\r\nnumbers\r\n<i>a, b, c</i>\r\n, . . . so that when the variables are replaced by the\r\nnumbers all the equations are satisfied. For example, in the\r\nequations above,\r\n<i>x =</i>\r\n4 and\r\n<i>y =</i>\r\n3 is a solution.'),(37,'/oy/math',0,'scientific notation','A shorthand way of writing very large or very small numbers.\r\nA number expressed in scientific notation is expressed as a\r\ndecimal number between 1 and 10 multiplied by a power of 10\r\n(e.g., 7000 = 7\r\n<font face=\'Symbol\'>×</font>\r\n10<sup>3</sup>\r\nor 0.0000019 = 1.9\r\n<font face=\'Symbol\'>×</font>\r\n10<sup>-6</sup>\r\n).'),(38,'/oy/math',0,'range','In statistics, the difference between the greatest and smallest values in a data set. In mathematics, the image of a function.'),(39,'/oy/math',0,'linear expression','An expression of the form\r\n<i>b</i>\r\n<i>ax +</i>\r\nwhere\r\n<i>x</i>\r\nis variable and\r\n<i>a</i>\r\nand\r\n<i>b</i>\r\nare constants; or in more variables, an expression of the\r\nform\r\n<i>ax + by +c, ax + by + cz + d</i>\r\n, etc.'),(43,'/ca/1997/math/standard',0,'1997 California Content Standards',NULL),(44,'/ca/1997/math/standard/pre-k',43,'1997 California Content Standards (PRE-K)',NULL),(45,'/ca/1997/math/standard/pre-k',44,'K.1.0','Children expand their understanding of numbers and quantities in their everyday environment.'),(46,'/ca/1997/math/standard/pre-k',44,'K.1.1','Recite numbers in order to twenty with increasing accuracy.'),(47,'/ca/1997/math/standard/pre-k',44,'K.1.2','Recognize and know the name of some written numerals.'),(48,'/ca/1997/math/standard/pre-k',44,'K.1.3','Identify, without counting, the number of objects in a collection of up to four objects (i.e., subitize).'),(49,'/ca/1997/math/standard/pre-k',44,'K.1.4','Count up to ten objects, using one-to-one correspondence (one object for each number word) with increasing accuracy.'),(50,'/ca/1997/math/standard/pre-k',44,'K.1.5','Understand, when counting, that the number name of the last object counted represents the total number of objects in the group (i.e., cardinality).'),(51,'/ca/1997/math/standard/pre-k',44,'K.2.0','Children expand their understanding of number relationships and operations in their everyday environment.'),(52,'/ca/1997/math/standard/pre-k',44,'K.2.1','Compare, by counting or matching, two groups of up to five objects and communicate, \"more,\" \"same as,\" or \"fewer\" (or \"less\").'),(53,'/ca/1997/math/standard/pre-k',44,'K.2.2','Understand that adding one or taking away one changes the number in a small group 