mbine different shapes to create a picture or design.'),(68,'/ca/1997/math/standard/pre-k',44,'K.2.0','Children expand their understanding of positions in space.'),(69,'/ca/1997/math/standard/pre-k',44,'K.2.1','Identify positions of objects and people in space, including in/on/ under, up/down, inside/outside, beside/between, and in front/behind.'),(70,'/ca/1997/math/standard/pre-k',44,'K.1.0','Children expand the use of mathematical thinking to solve problems that arise in their everyday environment.'),(71,'/ca/1997/math/standard/pre-k',44,'K.1.1','Identify and apply a variety of mathematical strategies to solve problems in their environment.'),(72,'/ca/1997/math/standard/k',43,'1997 California Content Standards (K)',NULL),(73,'/ca/1997/math/standard/k',72,'K.NS.1.0','Students understand the relationship between numbers and quantities (i.e., that a set of objects has the same number of objects in different situations regardless of its position or arrangement):'),(74,'/ca/1997/math/standard/k',72,'K.NS.1.1','Compare two or more sets of objects (up to ten objects in each group) and identify which set is equal to, more than, or less than the other.'),(75,'/ca/1997/math/standard/k',72,'K.NS.1.2','Count, recognize, represent, name, and order a number of objects (up to 30).'),(76,'/ca/1997/math/standard/k',72,'K.NS.1.3','Know that the larger numbers describe sets with more objects in them than the smaller numbers have.'),(77,'/ca/1997/math/standard/k',72,'K.NS.2.0','Students understand and describe simple additions and subtractions:'),(78,'/ca/1997/math/standard/k',72,'K.NS.2.1','Use concrete objects to determine the answers to addition and subtraction problems (for two numbers that are each less than 10).'),(79,'/ca/1997/math/standard/k',72,'K.NS.3.0','Students use estimation strategies in computation and problem solving that involve numbers that use the ones and tens places:'),(80,'/ca/1997/math/standard/k',72,'K.NS.3.1','Recognize when an estimate is reasonable.'),(81,'/ca/1997/math/standard/k',72,'K.AF.1.0','Students sort and classify objects:'),(82,'/ca/1997/math/standard/k',72,'K.AF.1.1','Identify, sort, and classify objects by attribute and identify objects that do not belong to a particular group (e.g., all these balls are green, those are red).'),(83,'/ca/1997/math/standard/k',72,'K.MG.1.0','Students understand the concept of time and units to measure it; they understand that objects have properties, such as length, weight, and capacity, and that comparisons may be made by referring to those properties:'),(84,'/ca/1997/math/standard/k',72,'K.MG.1.1','Compare the length, weight, and capacity of objects by making direct comparisons with reference objects (e.g., note which object is shorter, longer, taller, lighter, heavier, or holds more).'),(85,'/ca/1997/math/standard/k',72,'K.MG.1.2','Demonstrate an understanding of concepts of time (e.g., morning, afternoon, evening, today, yesterday, tomorrow, week, year) and tools that measure time (e.g., clock, calendar).'),(86,'/ca/1997/math/standard/k',72,'K.MG.1.3','Name the days of the week.'),(87,'/ca/1997/math/standard/k',72,'K.MG.1.4','Identify the time (to the nearest hour) of everyday events (e.g., lunch time is 12 o\'clock; bedtime is 8 o\'clock at night).'),(88,'/ca/1997/math/standard/k',72,'K.MG.2.0','Students identify common objects in their environment and describe the geometric features:'),(89,'/ca/1997/math/standard/k',72,'K.MG.2.1','Identify and describe common geometric objects (e.g., circle, triangle, square, rectangle, cube, sphere, cone).'),(90,'/ca/1997/math/standard/k',72,'K.MG.2.2','Compare familiar plane and solid objects by common attributes (e.g., position, shape, size, roundness, number of corners).'),(91,'/ca/1997/math/standard/k',72,'K.SDAP.1.0','Students collect information about objects and events in their environment:'),(92,'/ca/1997/math/standard/k',72,'K.SDAP.1.1','Pose information questions; collect data; and record the results using objects, pictures, and picture graphs.'),(93,'/ca/1997/math/standard/k',72,'K.SDAP.1.2','Identify, describe, and extend simple patterns (such as circles or triangles) by referring to their shapes, sizes, or colors.'),(94,'/ca/1997/math/standard/k',72,'K.MR.1.0','Students make decisions about how to set up a problem:'),(95,'/ca/1997/math/standard/k',72,'K.MR.1.1','Determine the approach, materials, and strategies to be used.'),(96,'/ca/1997/math/standard/k',72,'K.MR.1.2','Use tools and strategies, such as manipulatives or sketches, to model problems.'),(97,'/ca/1997/math/standard/k',72,'K.MR.2.0','Students solve problems in reasonable ways and justify their reasoning:'),(98,'/ca/1997/math/standard/k',72,'K.MR.2.1','Explain the reasoning used with concrete objects and/or pictorial representations.'),(99,'/ca/1997/math/standard/k',72,'K.MR.2.2','Make precise calculations and check the validity of the results in the context of the problem.'),(100,'/ca/1997/math/standard/grade-1',43,'1997 California Content Standards (Grade-1)',NULL),(101,'/ca/1997/math/standard/grade-1',100,'1.NS.1.0','Students understand and use numbers up to 100:'),(102,'/ca/1997/math/standard/grade-1',100,'1.NS.1.1','Count, read, and write whole numbers to 100.'),(103,'/ca/1997/math/standard/grade-1',100,'1.NS.1.2','Compare and order whole numbers to 100 by using the symbols for less than, equal to, or greater than (<, =, >).'),(104,'/ca/1997/math/standard/grade-1',100,'1.NS.1.3','Represent equivalent forms of the same number through the use of physical models, diagrams, and number expressions (to 20) (e.g., 8 may be represented as 4 + 4, 5 + 3, 2 + 2 + 2 + 2, 10 - 2, 11 - 3).'),(105,'/ca/1997/math/standard/grade-1',100,'1.NS.1.4','Count and group object in ones and tens (e.g., three groups of 10 and 4 equals 34, or 30 + 4).'),(106,'/ca/1997/math/standard/grade-1',100,'1.NS.1.5','Identify and know the value of coins and show different combinations of coins that equal the same value.'),(107,'/ca/1997/math/standard/grade-1',100,'1.NS.2.0','Students demonstrate the meaning of addition and subtraction and use these operations to solve problems:'),(108,'/ca/1997/math/standard/grade-1',100,'1.NS.2.1','Know the addition facts (sums to 20) and the corresponding subtraction facts and commit them to memory.'),(109,'/ca/1997/math/standard/grade-1',100,'1.NS.2.2','Use the inverse relationship between addition and subtraction to solve problems.'),(110,'/ca/1997/math/standard/grade-1',100,'1.NS.2.3','Identify one more than, one less than, 10 more than, and 10 less than a given number.'),(111,'/ca/1997/math/standard/grade-1',100,'1.NS.2.4','Count by 2s, 5s, and 10s to 100.'),(112,'/ca/1997/math/standard/grade-1',100,'1.NS.2.5','Show the meaning of addition (putting together, increasing) and subtraction (taking away, comparing, finding the difference).'),(113,'/ca/1997/math/standard/grade-1',100,'1.NS.2.6','Solve addition and subtraction problems with one- and two-digit numbers (e.g., 5 + 58 = __).'),(114,'/ca/1997/math/standard/grade-1',100,'1.NS.2.7','Find the sum of three one-digit numbers.'),(115,'/ca/1997/math/standard/grade-1',100,'1.NS.3.0','Students use estimation strategies in computation and problem solving that involve numbers that use the ones, tens, and hundreds places:'),(116,'/ca/1997/math/standard/grade-1',100,'1.NS.3.1','Make reasonable estimates when comparing larger or smaller numbers.'),(117,'/ca/1997/math/standard/grade-1',100,'1.AF.1.0','Students use number sentences with operational symbols and expressions to solve problems:'),(118,'/ca/1997/math/standard/grade-1',100,'1.AF.1.1','Write and solve number sentences from problem situations that express relationships involving addition and subtraction.'),(119,'/ca/1997/math/standard/grade-1',100,'1.AF.1.2','Understand the meaning of the symbols +, -, =.'),(120,'/ca/1997/math/standard/grade-1',100,'1.AF.1.3','Create problem situations that might lead to given number sentences involving addition and subtraction.'),(121,'/ca/199