 a.m. to 4:00 p.m.).'),(173,'/ca/1997/math/standard/grade-2',141,'2.MG.2.0','Students identify and describe the attributes of common figures in the plane and of common objects in space:'),(174,'/ca/1997/math/standard/grade-2',141,'2.MG.2.1','Describe and classify plane and solid geometric shapes (e.g., circle, triangle, square, rectangle, sphere, pyramid, cube, rectangular prism) according to the number and shape of faces, edges, and vertices.'),(175,'/ca/1997/math/standard/grade-2',141,'2.MG.2.2','Put shapes together and take them apart to form other shapes (e.g., two congruent right triangles can be arranged to form a rectangle).'),(176,'/ca/1997/math/standard/grade-2',141,'2.SDAP.1.0','Students collect numerical data and record, organize, display, and interpret the data on bar graphs and other representations:'),(177,'/ca/1997/math/standard/grade-2',141,'2.SDAP.1.1','Record numerical data in systematic ways, keeping track of what has been counted.'),(178,'/ca/1997/math/standard/grade-2',141,'2.SDAP.1.2','Represent the same data set in more than one way (e.g., bar graphs and charts with tallies).'),(179,'/ca/1997/math/standard/grade-2',141,'2.SDAP.1.3','Identify features of data sets (range and mode).'),(180,'/ca/1997/math/standard/grade-2',141,'2.SDAP.1.4','Ask and answer simple questions related to data representations.'),(181,'/ca/1997/math/standard/grade-2',141,'2.SDAP.2.0','Students demonstrate an understanding of patterns and how patterns grow and describe them in general ways:'),(182,'/ca/1997/math/standard/grade-2',141,'2.SDAP.2.1','Recognize, describe, and extend patterns and determine a next term in linear patterns (e.g., 4, 8, 12 ...; the number of ears on one horse, two horses, three horses, four horses).'),(183,'/ca/1997/math/standard/grade-2',141,'2.SDAP.2.2','Solve problems involving simple number patterns.'),(184,'/ca/1997/math/standard/grade-2',141,'2.MR.1.0','Students make decisions about how to set up a problem:'),(185,'/ca/1997/math/standard/grade-2',141,'2.MR.1.1','Determine the approach, materials, and strategies to be used.'),(186,'/ca/1997/math/standard/grade-2',141,'2.MR.1.2','Use tools, such as manipulatives or sketches, to model problems.'),(187,'/ca/1997/math/standard/grade-2',141,'2.MR.2.0','Students solve problems and justify their reasoning:'),(188,'/ca/1997/math/standard/grade-2',141,'2.MR.2.1','Defend the reasoning used and justify the procedures selected.'),(189,'/ca/1997/math/standard/grade-2',141,'2.MR.2.2','Make precise calculations and check the validity of the results in the context of the problem.'),(190,'/ca/1997/math/standard/grade-2',141,'2.MR.3.0','Students note connections between one problem and another.'),(191,'/ca/1997/math/standard/grade-3',43,'1997 California Content Standards (Grade-3)',NULL),(192,'/ca/1997/math/standard/grade-3',191,'3.NS.1.0','Students understand the place value of whole numbers:'),(193,'/ca/1997/math/standard/grade-3',191,'3.NS.1.1','Count, read, and write whole numbers to 10,000.'),(194,'/ca/1997/math/standard/grade-3',191,'3.NS.1.2','Compare and order whole numbers to 10,000.'),(195,'/ca/1997/math/standard/grade-3',191,'3.NS.1.3','Identify the place value for each digit in numbers to 10,000.'),(196,'/ca/1997/math/standard/grade-3',191,'3.NS.1.4','Round off numbers to 10,000 to the nearest ten, hundred, and thousand.'),(197,'/ca/1997/math/standard/grade-3',191,'3.NS.1.5','Use expanded notation to represent numbers (e.g., 3,206 = 3,000 + 200 + 6).'),(198,'/ca/1997/math/standard/grade-3',191,'3.NS.2.0','Students calculate and solve problems involving addition, subtraction, multiplication, and division:'),(199,'/ca/1997/math/standard/grade-3',191,'3.NS.2.1','Find the sum or difference of two whole numbers between 0 and 10,000.'),(200,'/ca/1997/math/standard/grade-3',191,'3.NS.2.2','Memorize to automaticity the multiplication table for numbers between 1 and 10.'),(201,'/ca/1997/math/standard/grade-3',191,'3.NS.2.3','Use the inverse relationship of multiplication and division to compute and check results.'),(202,'/ca/1997/math/standard/grade-3',191,'3.NS.2.4','Solve simple problems involving multiplication of multidigit numbers by one-digit numbers (3,671 x 3 = __).'),(203,'/ca/1997/math/standard/grade-3',191,'3.NS.2.5','Solve division problems in which a multidigit number is evenly divided by a one-digit number (135 Ã· 5 = __).'),(204,'/ca/1997/math/standard/grade-3',191,'3.NS.2.6','Understand the special properties of 0 and 1 in multiplication and division.'),(205,'/ca/1997/math/standard/grade-3',191,'3.NS.2.7','Determine the unit cost when given the total cost and number of units.'),(206,'/ca/1997/math/standard/grade-3',191,'3.NS.2.8','Solve problems that require two or more of the skills mentioned above.'),(207,'/ca/1997/math/standard/grade-3',191,'3.NS.3.0','Students understand the relationship between whole numbers, simple fractions, and decimals:'),(208,'/ca/1997/math/standard/grade-3',191,'3.NS.3.1','Compare fractions represented by drawings or concrete materials to show equivalency and to add and subtract simple fractions in context (e.g., 1/2 of a pizza is the same amount as 2/4 of another pizza that is the same size; show that 3/8 is larger than 1/4).'),(209,'/ca/1997/math/standard/grade-3',191,'3.NS.3.2','Add and subtract simple fractions (e.g., determine that 1/8 + 3/8 is the same as 1/2).'),(210,'/ca/1997/math/standard/grade-3',191,'3.NS.3.3','Solve problems involving addition, subtraction, multiplication, and division of money amounts in decimal notation and multiply and divide money amounts in decimal notation by using whole-number multipliers and divisors.'),(211,'/ca/1997/math/standard/grade-3',191,'3.NS.3.4','Know and understand that fractions and decimals are two different representations of the same concept (e.g., 50 cents is 1/2 of a dollar, 75 cents is 3/4 of a dollar).'),(212,'/ca/1997/math/standard/grade-3',191,'3.AF.1.0','Students select appropriate symbols, operations, and properties to represent, describe, simplify, and solve simple number relationships:'),(213,'/ca/1997/math/standard/grade-3',191,'3.AF.1.1','Represent relationships of quantities in the form of mathematical expressions, equations, or inequalities.'),(214,'/ca/1997/math/standard/grade-3',191,'3.AF.1.2','Solve problems involving numeric equations or inequalities.'),(215,'/ca/1997/math/standard/grade-3',191,'3.AF.1.3','Select appropriate operational and relational symbols to make an expression true (e.g., if 4 __ 3 = 12, what operational symbol goes in the blank?).'),(216,'/ca/1997/math/standard/grade-3',191,'3.AF.1.4','Express simple unit conversions in symbolic form (e.g., __ inches = __ feet x 12).'),(217,'/ca/1997/math/standard/grade-3',191,'3.AF.1.5','Recognize and use the commutative and associative properties of multiplication (e.g., if 5 x 7 = 35, then what is 7 x 5? and if 5 x 7 x 3 = 105, then what is 7 x 3 x 5?).'),(218,'/ca/1997/math/standard/grade-3',191,'3.AF.2.0','Students represent simple functional relationships:'),(219,'/ca/1997/math/standard/grade-3',191,'3.AF.2.1','Solve simple problems involving a functional relationship between two quantities (e.g., find the total cost of multiple items given the cost per unit).'),(220,'/ca/1997/math/standard/grade-3',191,'3.AF.2.2','Extend and recognize a linear pattern by its rules (e.g., the number of legs on a given number of horses may be calculated by counting by 4s or by multiplying the number of horses by 4).'),(221,'/ca/1997/math/standard/grade-3',191,'3.MG.1.0','Students choose and use appropriate units and measurement tools to quantify the properties of objects:'),(222,'/ca/1997/math/standard/grade-3',191,'3.MG.1.1','Choose the appropriate tools and units (metric and U.S.) and estimate and measure the length, liquid volume, and weight/mass of given objects.'),(223,'/ca/1997/math/standard/grade-3',191,'3.MG.1.2','Estimate or determine the area and volume of solid figures by covering them with squares or by counting the number of cubes that would fill them.'),(224,'/ca/1997/math/standard/grade-3',191,'3.MG.1.3','Find the perimeter of a polygon with integer sides.'),(225,'/ca/1997/math/standard/grade-3',191,'3.MG.1.4','Carry out simple unit conversions within a system of measurement (e.g., centimeters and meters, hours and minutes).'),(226,'/ca/1997/math/standard/grade-3',191,'3.MG.2.0','Students describe and compare the attributes of plane and solid geometric figures and use their understanding to show relationships and solve problems:'),(227,'/ca/1997/math/standard/grade-3',191,'3.MG.2.1','Identify, describe, and classify polygons (including pentagons, hexagons, and octagons).'),(228,'/ca/1997/math/standard/grade-3',191,'3.MG.2.2','Identify attributes of triangles (e.g., two equal sides for the isosceles triangle, three equal sides for the equilateral triangle, right angle for the right triangle).'),(229,'/ca/1997/math/standard/grade-3',191,'3.MG.2.3','Identify attributes of quadrilaterals (e.g., parallel sides for the parallelogram, right angles for the rectangle, equal sides and right angles for the square).'),(230,'/ca/1997/math/standard/grade-3',191,'3.MG.2.4','Identify right angles in geometric figures or in appropriate objects and determine whether other angles are greater or less than a right angle.'),(231,'/ca/1997/math/standard/grade-3',191,'3.MG.2.5','Identify, describe, and classify common three-dimensional geometric objects (e.g., cube, rectangular solid, sphere, prism, pyramid, cone, cylinder).'),(232,'/ca/1997/math/standard/grade-3',191,'3.MG.2.6','Identify common solid objects that are the components needed to make a more complex solid object.'),(233,'/ca/1997/math/standard/grade-3',191,'3.SDAP.1.0','Students conduct simple probability experiments by determining the number of possible outcomes and make simple predictions:'),(234,'/ca/1997/math/standard/grade-3',191,'3.SDAP.1.1','Identify whether common events are certain, likely, unlikely, or improbable.'),(235,'/ca/1997/math/standard/grade-3',191,'3.SDAP.1.2','Record the possible outcomes for a simple event (e.g., tossing a coin) and systematically keep track of the outcomes when the event is repeated many times.'),(236,'/ca/1997/math/standard/grade-3',191,'3.SDAP.1.3','Summarize and display the results of probability experiments in a clear and organized way (e.g., use a bar graph or a line plot).'),(237,'/ca/1997/math/standard/grade-3',191,'3.SDAP.1.4','Use the results of probability experiments to predict future events (e.g., use a line plot to predict the temperature forecast for the next day).'),(238,'/ca/1997/math/standard/grade-3',191,'3.MR.1.0','Students make decisions about how to approach problems:'),(239,'/ca/1997/math/standard/grade-3',191,'3.MR.1.1','Analyze problems by identifying relationships, distinguishing relevant from irrelevant information, sequencing and prioritizing information, and observing patterns.'),(240,'/ca/1997/math/standard/grade-3',191,'3.MR.1.2','Determine when and how to break a problem into simpler parts.'),(241,'/ca/1997/math/standard/grade-3',191,'3.MR.2.0','Students use strategies, skills, and concepts in finding solutions:'),(242,'/ca/1997/math/standard/grade-3',191,'3.MR.2.1','Use estimation to verify the reasonableness of calculated results.'),(243,'/ca/1997/math/standard/grade-3',191,'3.MR.2.2','Apply strategies and results from simpler problems to more complex problems.'),(244,'/ca/1997/math/standard/grade-3',191,'3.MR.2.3','Use a variety of methods, such as words, numbers, symbols, charts, graphs, tables, diagrams, and models, to explain mathematical reasoning.'),(245,'/ca/1997/math/standard/grade-3',191,'3.MR.2.4','Express the solution clearly and logically by using the appropriate mathematical notation and terms and clear language; support solutions with evidence in both verbal and symbolic work.'),(246,'/ca/1997/math/standard/grade-3',191,'3.MR.2.5','Indicate the relative advantages of exact and approximate solutions to problems and give answers to a specified degree of accuracy.'),(247,'/ca/1997/math/standard/grade-3',191,'3.MR.2.6','Make precise calculations and check the validity of the results from the context of the problem.'),(248,'/ca/1997/math/standard/grade-3',191,'3.MR.3.0','Students move beyond a particular problem by generalizing to other situations:'),(249,'/ca/1997/math/standard/grade-3',191,'3.MR.3.1','Evaluate the reasonableness of the solution in the context of the original situation.'),(250,'/ca/1997/math/standard/grade-3',191,'3.MR.3.2','Note the method of deriving the solution and demonstrate a conceptual understanding of the derivation by solving similar problems.'),(251,'/ca/1997/math/standard/grade-3',191,'3.MR.3.3','Develop generalizations of the results obtained and apply them in other circumstances.'),(252,'/ca/1997/math/standard/grade-4',43,'1997 California Content Standards (Grade-4)',NULL),(253,'/ca/1997/math/standard/grade-4',252,'4.NS.1.0','Students understand the place value of whole numbers and decimals to two decimal places and how whole numbers and decimals relate to simple fractions. Students use the concepts of negative numbers:'),(254,'/ca/1997/math/standard/grade-4',252,'4.NS.1.1','Read and write whole numbers in the millions.'),(255,'/ca/1997/math/standard/grade-4',252,'4.NS.1.2','Order and compare whole numbers and decimals to two decimal places.'),(256,'/ca/1997/math/standard/grade-4',252,'4.NS.1.3','Round whole numbers through the millions to the nearest ten, hundred, thousand, ten thousand, or hundred thousand.'),(257,'/ca/1997/math/standard/grade-4',252,'4.NS.1.4','Decide when a rounded solution is called for and explain why such a solution may be appropriate.'),(258,'/ca/1997/math/standard/grade-4',252,'4.NS.1.5','Explain different interpretations of fractions, for example, parts of a whole, parts of a set, and division of whole numbers by whole numbers; explain equivalents of fractions (see Standard 4.0).'),(259,'/ca/1997/math/standard/grade-4',252,