Know and understand that equals added to equals are equal.'),(282,'/ca/1997/math/standard/grade-4',252,'4.AF.2.2','Know and understand that equals multiplied by equals are equal.'),(283,'/ca/1997/math/standard/grade-4',252,'4.MG.1.0','Students understand perimeter and area:'),(284,'/ca/1997/math/standard/grade-4',252,'4.MG.1.1','Measure the area of rectangular shapes by using appropriate units, such as square centimeter (cmÂ²), square meter (mÂ²), square kilometer (kmÂ²), square inch (inÂ²), square yard (ydÂ²), or square mile (miÂ²).'),(285,'/ca/1997/math/standard/grade-4',252,'4.MG.1.2','Recognize that rectangles that have the same area can have different perimeters.'),(286,'/ca/1997/math/standard/grade-4',252,'4.MG.1.3','Understand that rectangles that have the same perimeter can have different areas.'),(287,'/ca/1997/math/standard/grade-4',252,'4.MG.1.4','Understand and use formulas to solve problems involving perimeters and areas of rectangles and squares. Use those formulas to find the areas of more complex figures by dividing the figures into basic shapes.'),(288,'/ca/1997/math/standard/grade-4',252,'4.MG.2.0','Students use two-dimensional coordinate grids to represent points and graph lines and simple figures:'),(289,'/ca/1997/math/standard/grade-4',252,'4.MG.2.1','Draw the points corresponding to linear relationships on graph paper (e.g., draw 10 points on the graph of the equation y = 3x and connect them by using a straight line).'),(290,'/ca/1997/math/standard/grade-4',252,'4.MG.2.2','Understand that the length of a horizontal line segment equals the difference of the x-coordinates.'),(291,'/ca/1997/math/standard/grade-4',252,'4.MG.2.3','Understand that the length of a vertical line segment equals the difference of the y-coordinates.'),(292,'/ca/1997/math/standard/grade-4',252,'4.MG.3.0','Students demonstrate an understanding of plane and solid geometric objects and use this knowledge to show relationships and solve problems:'),(293,'/ca/1997/math/standard/grade-4',252,'4.MG.3.1','Identify lines that are parallel and perpendicular.'),(294,'/ca/1997/math/standard/grade-4',252,'4.MG.3.2','Identify the radius and diameter of a circle.'),(295,'/ca/1997/math/standard/grade-4',252,'4.MG.3.3','Identify congruent figures.'),(296,'/ca/1997/math/standard/grade-4',252,'4.MG.3.4','Identify figures that have bilateral and rotational symmetry.'),(297,'/ca/1997/math/standard/grade-4',252,'4.MG.3.5','Know the definitions of a right angle, an acute angle, and an obtuse angle. Understand that 90Â°, 180Â°, 270Â°, and 360Â° are associated, respectively, with 1/4, 1/2, 3/4, and full turns.'),(298,'/ca/1997/math/standard/grade-4',252,'4.MG.3.6','Visualize, describe, and make models of geometric solids (e.g., prisms, pyramids) in terms of the number and shape of faces, edges, and vertices; interpret two-dimensional representations of three-dimensional objects; and draw patterns (of faces) for a solid that, when cut and folded, will make a model of the solid.'),(299,'/ca/1997/math/standard/grade-4',252,'4.MG.3.7','Know the definitions of different triangles (e.g., equilateral, isosceles, scalene) and identify their attributes.'),(300,'/ca/1997/math/standard/grade-4',252,'4.MG.3.8','Know the definition of different quadrilaterals (e.g., rhombus, square, rectangle, parallelogram, trapezoid).'),(301,'/ca/1997/math/standard/grade-4',252,'4.SDAP.1.0','Students organize, represent, and interpret numerical and categorical data and clearly communicate their findings:'),(302,'/ca/1997/math/standard/grade-4',252,'4.SDAP.1.1','Formulate survey questions; systematically collect and represent data on a number line; and coordinate graphs, tables, and charts.'),(303,'/ca/1997/math/standard/grade-4',252,'4.SDAP.1.2','Identify the mode(s) for sets of categorical data and the mode(s), median, and any apparent outliers for numerical data sets.'),(304,'/ca/1997/math/standard/grade-4',252,'4.SDAP.1.3','Interpret one- and two-variable data graphs to answer questions about a situation.'),(305,'/ca/1997/math/standard/grade-4',252,'4.SDAP.2.0','Students make predictions for simple probability situations:'),(306,'/ca/1997/math/standard/grade-4',252,'4.SDAP.2.1','Represent all possible outcomes for a simple probability situation in an organized way (e.g., tables, grids, tree diagrams).'),(307,'/ca/1997/math/standard/grade-4',252,'4.SDAP.2.2','Express outcomes of experimental probability situations verbally and numerically (e.g., 3 out of 4; 3 /4).'),(308,'/ca/1997/math/standard/grade-4',252,'4.MR.1.0','Students make decisions about how to approach problems:'),(309,'/ca/1997/math/standard/grade-4',252,'4.MR.1.1','Analyze problems by identifying relationships, distinguishing relevant from irrelevant information, sequencing and prioritizing information, and observing patterns.'),(310,'/ca/1997/math/standard/grade-4',252,'4.MR.1.2','Determine when and how to break a problem into simpler parts.'),(311,'/ca/1997/math/standard/grade-4',252,'4.MR.2.0','Students use strategies, skills, and concepts in finding solutions:'),(312,'/ca/1997/math/standard/grade-4',252,'4.MR.2.1','Use estimation to verify the reasonableness of calculated results.'),(313,'/ca/1997/math/standard/grade-4',252,'4.MR.2.2','Apply strategies and results from simpler problems to more complex problems.'),(314,'/ca/1997/math/standard/grade-4',252,'4.MR.2.3','Use a variety of methods, such as words, numbers, symbols, charts, graphs, tables, diagrams, and models, to explain mathematical reasoning.'),(315,'/ca/1997/math/standard/grade-4',252,'4.MR.2.4','Express the solution clearly and logically by using the appropriate mathematical notation and terms and clear language; support solutions with evidence in both verbal and symbolic work.'),(316,'/ca/1997/math/standard/grade-4',252,'4.MR.2.5','Indicate the relative advantages of exact and approximate solutions to problems and give answers to a specified degree of accuracy.'),(317,'/ca/1997/math/standard/grade-4',252,'4.MR.2.