 sum of the angles of any triangle is 180Know that the sum of the angles of any triangle is 180Â° and the sum of the angles of any quadrilateral is 360Â° and use this information to solve problems.'),(349,'/ca/1997/math/standard/grade-5',322,'5.MG.2.3','Visualize and draw two-dimensional views of three-dimensional objects made from rectangular solids.'),(350,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.0','Students display, analyze, compare, and interpret different data sets, including data sets of different sizes:'),(351,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.1','Know the concepts of mean, median, and mode; compute and compare simple examples to show that they may differ.'),(352,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.2','Organize and display single-variable data in appropriate graphs and representations (e.g., histogram, circle graphs) and explain which types of graphs are appropriate for various data sets.'),(353,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.3','Use fractions and percentages to compare data sets of different sizes.'),(354,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.4','Identify ordered pairs of data from a graph and interpret the meaning of the data in terms of the situation depicted by the graph.'),(355,'/ca/1997/math/standard/grade-5',322,'5.SDAP.1.5','Know how to write ordered pairs correctly; for example, (x, y).'),(356,'/ca/1997/math/standard/grade-5',322,'5.MR.1.0','Students make decisions about how to approach problems:'),(357,'/ca/1997/math/standard/grade-5',322,'5.MR.1.1','Analyze problems by identifying relationships, distinguishing relevant from irrelevant information, sequencing and prioritizing information, and observing patterns.'),(358,'/ca/1997/math/standard/grade-5',322,'5.MR.1.2','Determine when and how to break a problem into simpler parts.'),(359,'/ca/1997/math/standard/grade-5',322,'5.MR.2.0','Students use strategies, skills, and concepts in finding solutions:'),(360,'/ca/1997/math/standard/grade-5',322,'5.MR.2.1','Use estimation to verify the reasonableness of calculated results.'),(361,'/ca/1997/math/standard/grade-5',322,'5.MR.2.2','Apply strategies and results from simpler problems to more complex problems.'),(362,'/ca/1997/math/standard/grade-5',322,'5.MR.2.3','Use a variety of methods, such as words, numbers, symbols, charts, graphs, tables, diagrams, and models, to explain mathematical reasoning.'),(363,'/ca/1997/math/standard/grade-5',322,'5.MR.2.4','Express the solution clearly and logically by using the appropriate mathematical notation and terms and clear language; support solutions with evidence in both verbal and symbolic work.'),(364,'/ca/1997/math/standard/grade-5',322,'5.MR.2.5','Indicate the relative advantages of exact and approximate solutions to problems and give answers to a specified degree of accuracy.'),(365,'/ca/1997/math/standard/grade-5',322,'5.MR.2.6','Make precise calculations and check the validity of the results from the context of the problem.'),(366,'/ca/1997/math/standard/grade-5',322,'5.MR.3.0','Students move beyond a particular problem by generalizing to other situations:'),(367,'/ca/1997/math/standard/grade-5',322,'5.MR.3.1','Evaluate the reasonableness of the solution in the context of the original situation.'),(368,'/ca/1997/math/standard/grade-5',322,'5.MR.3.2','Note the method of deriving the solution and demonstrate a conceptual understanding of the derivation by solving similar problems.'),(369,'/ca/1997/math/standard/grade-5',322,'5.MR.3.3','Develop generalizations of the results obtained and apply them in other circumstances.'),(370,'/ca/1997/math/standard/grade-6',43,'1997 California Content Standards (Grade-6)',NULL),(371,'/ca/1997/math/standard/grade-6',370,'6.NS.1.0','Students compare and order positive and negative fractions, decimals, and mixed numbers. Students solve problems involving fractions, ratios, proportions, and percentages:'),(372,'/ca/1997/math/standard/grade-6',370,'6.NS.1.1','Compare and order positive and negative fractions, decimals, and mixed numbers and place them on a number line.'),(373,'/ca/1997/math/standard/grade-6',370,'6.NS.1.2','Interpret and use ratios in different contexts (e.g., batting averages, miles per hour) to show the relative sizes of two quantities, using appropriate notations (a/b, a to b, a:b).'),(374,'/ca/1997/math/standard/grade-6',370,'6.NS.1.3','Use proportions to solve problems (e.g., determine the value of N if 4/7 = N/21, find the length of a side of a polygon similar to a known polygon). Use cross-multiplication as a method for solving such problems, understanding it as the multiplication of both sides of an equation by a multiplicative inverse.'),(375,'/ca/1997/math/standard/grade-6',370,'6.NS.1.4','Calculate given percentages of quantities and solve problems involving discounts at sales, interest earned, and tips.'),(376,'/ca/1997/math/standard/grade-6',370,'6.NS.2.0','Students calculate and solve problems involving addition, subtraction, multiplication, and division:'),(377,'/ca/1997/math/standard/grade-6',370,'6.NS.2.1','Solve problems involving addition, subtraction, multiplication, and division of positive fractions and explain why a particular operation was used for a given situation.'),(378,'/ca/1997/math/standard/grade-6',370,'6.NS.2.2','Explain the meaning of multiplication and division of positive fractions and perform the calculations (e.g., 5/8 Ã· 15/16 = 5/8 x 16/15 = 2/3).'),(379,'/ca/1997/math/standard/grade-6',370,'6.NS.2.3','Solve addition, subtraction, multiplication, and division problems, including those arising in concrete situations, that use positive and negative integers and combinations of these operations.'),(380,'/ca/1997/math/standard/grade-6',370,'6.NS.2.4','Determine the least common multiple and the greatest common divisor of whole numbers; use them to solve problems with fractions (e.g., to find a common denominator to add two fractions or to find the reduced form for a fraction).'),(381,'/ca/1997/math/standard/grade-6',370,'6.AF.1.0','Students write verbal expressions and sentences as algebraic expressions and equations; they evaluate algebraic expressions, solve simple linear equations, and graph and interpret their results:'),(382,'/ca/1997/math/standard/grade-6',370,'6.AF.1.1','Write and solve one-step linear equations in one variable.'),(383,'/ca/1997/math/standard/grade-6',370,'6.AF.1.2','Write and evaluate an algebraic expression for a given situation, using up to three variables.'),(384,'/ca/1997/math/standard/grade-6',370,'6.AF.1.3','Apply algebraic order of operations and the commutative, associative, and distributive properties to evaluate expressions; and justify each step in the process.'),(385,'/ca/1997/math/standard/grade-6',370,'6.AF.1.4','Solve problems manually by using the correct order of operations or by using a scientific calculator.'),(386,'/ca/1997/math/standard/grade-6',370,'6.AF.2.0','Students analyze and use tables, graphs, and rules to solve problems involving rates and proportions:'),(387,'/ca/1997/math/standard/grade-6',370,'6.AF.2.1','Convert one unit of measurement to another (e.g., from feet to miles, from centimeters to inches).'),(388,'/ca/1997/math/standard/grade-6',370,'6.AF.2.2','Demonstrate an understanding that rate is a measure of one quantity per unit value of another quantity.'),(389,'/ca/1997/math/standard/grade-6',370,'6.AF.2.3','Solve problems involving rates, average speed, distance, and time.'),(390,'/ca/1997/math/standard/grade-6',370,'6.AF.3.0','Students investigate geometric patterns and describe them algebraically:'),(391,'/ca/1997/math/standard/grade-6',370,'6.AF.3.1','Use variables in expressions describing geometric quantities (e.g., P = 2w + 2l, A = 1/2 bh, C = pi d - the formulas for the perimeter of a rectangle, the area of a triangle, and the circumference of a circle, respectively).'),(392,'/ca/1997/math/standard/grade-6',370,'6.AF.3.2','Express in symbolic form simple relationships arising from geometry.'),(393,'/ca/1997/math/standard/grade-6',370,'6.MG.1.0','Students deepen their understanding of the measurement of plane and solid shapes and use this understanding to solve problems:'),(394,'/ca/1997/math/standard/grade-6',370,'6.MG.1.1','Understand the concept of a constant such as pi; know the formulas for the circumference and area of a circle.'),(395,'/ca/1997/math/standard/grade-6',370,'6.MG.1.2','Know common estimates of pi (3.14; 22/7) and use these values to estimate and calculate the circumference and the area of circles; compare with actual measurements.'),(396,'/ca/1997/math/standard/grade-6',370,'6.MG.1.3','Know and use the formulas for the volume of triangular prisms and cylinders (area of base x height); compare these formulas and explain the similarity between them and the formula for the volume of a rectangular solid.'),(397,'/ca/1997/math/standard/grade-6',370,'6.MG.2.0','Students identify and describe the properties of two-dimensional figures:'),(398,'/ca/1997/math/standard/grade-6',370,'6.MG.2.1','Identify angles as vertical, adjacent, complementary, or supplementary and provide descriptions of these terms.'),(399,'/ca/1997/math/standard/grade-6',370,'6.MG.2.2','Use the properties of complementary and supplementary angles and the sum of the angles of a triangle to solve problems involving an unknown angle.'),(400,'/ca/1997/math/standard/grade-6',370,'6.MG.2.3','Draw quadrilaterals and triangles from given information about them (e.g., a quadrilateral having equal sides but no right angles, a right isosceles triangle).'),(401,'/ca/1997/math/standard/grade-6',370,'6.SDAP.1.0','Students compute and analyze statistical measurements for data sets:'),(402,'/ca/1997/math/standard/grade-6',370,'6.SDAP.1.1','Compute the range, mean, median, and mode of data sets.'),(403,'/ca/1997/math/standard/grade-6',370,'6.SDAP.1.2','Understand how additional data added to data sets may affect these computations of measures of central tendency.'),(404,'/ca/1997/math/standard/grade-6',370,'6.SDAP.1.3','Understand how the inclusion or exclusion of outliers affects measures of central tendency.'),(405,'/ca/1997/math/standard/grade-6',370,'6.SDAP.1.4','Know why a specific measure of central tendency (mean, median, mode) provides the most useful information in a given context.'),(406,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.0','Students use data samples of a population and describe the characteristics and limitations of the samples:'),(407,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.1','Compare different samples of a population with the data from the entire population and identify a situation in which it makes sense to use a sample.'),(408,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.2','Identify different ways of selecting a sample (e.g., convenience sampling, responses to a survey, random sampling) and which method makes a sample more representative for a population.'),(409,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.3','Analyze data displays and explain why the way in which the question was asked might have influenced the results obtained and why the way in which the results were displayed might have influenced the conclusions reached.'),(410,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.4','Identify data that represent sampling errors and explain why the sample (and the display) might be biased.'),(411,'/ca/1997/math/standard/grade-6',370,'6.SDAP.2.5','Identify claims based on statistical data and, in simple cases, evaluate the validity of the claims.'),(412,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.0','Students determine theoretical and experimental probabilities and use these to make predictions about events:'),(413,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.1','Represent all possible outcomes for compound events in an organized way (e.g., tables, grids, tree diagrams) and express the theoretical probability of each outcome.'),(414,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.2','Use data to estimate the probability of future events (e.g., batting averages or number of accidents per mile driven).'),(415,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.3','Represent probabilities as ratios, proportions, decimals between 0 and 1, and percentages between 0 and 100 and verify that the probabilities computed are reasonable; know that if P is the probability of an event, 1 - P is the probability of an event not occurring.'),(416,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.4','Understand that the probability of either of two disjoint events occurring is the sum of the two individual probabilities and that the probability of one event following another, in independent trials, is the product of the two probabilities.'),(417,'/ca/1997/math/standard/grade-6',370,'6.SDAP.3.5','Understand the difference between independent and dependent events.'),(418,'/ca/1997/math/standard/grade-6',370,'6.MR.1.0','Students make decisions about how to approach problems:'),(419,'/ca/1997/math/standard/grade-6',370,'6.MR.1.1','Analyze problems by identifying relationships, distinguishing relevant from irrelevant information, identifying missing information, sequencing and prioritizing information, and observing patterns.'),(420,'/ca/1997/math/standard/grade-6',370,'6.MR.1.2','Formulate and justify mathematical conjectures based on a general description of the mathematical question or problem posed.'),(421,'/ca/1997/math/standard/grade-6',370,'6.MR.1.3','Determine when and how to break a problem into simpler parts.'),(422,'/ca/1997/math/standard/grade-6',370,'6.MR.2.0','Students use strategies, skills, and concepts in finding solutions:'),(423,'/ca/1997/math/standard/grade-6',370,'6.MR.2.1','Use estimation to verify the reasonableness of calculated results.'),(424,'/ca/1997/math/standard/grade-6',370,'6.MR.2.2','Apply strategies and results from simpler problems to more complex problems.'),(425,'/ca/1997/math/standard/grade-6',370,'6.MR.2.3','Estimate unknown quantities graphically and solve for them by using logical reasoning and arithmetic and algebraic techniques.'),(426,'/ca/1997/math/standard/grade-6',370,'6.MR.2.4','Use a variety of methods, such as words, numbers, symbols, charts, graphs, tables, diagrams, and models, to explain mathematical reasoning.'),(427,'/ca/1997/math/standard/grade-6',370,'6.MR.2.5','Express the solution clearly and logically by using the appropriate mathematical notation and terms and clear language; support solutions with evidence in both verbal and symbolic work.'),(428,'/ca/1997/math/standard/grade-6',370,'6.MR.2.6','Indicate the relative advantages of exact and approximate solutions to problems and give answers to a specified degree of accuracy.'),(429,'/ca/1997/math/standard/grade-6',370,'6.MR.2.7','Make precise calculations and check the validity of the results from the context of the problem.'),(430,'/ca/1997/math/standard/grade-6',370,'6.MR.3.0','Students move beyond a particular problem by generalizing to other situations:'),(431,'/ca/1997/math/standard/grade-6',370,'6.MR.3.1','Evaluate the reasonableness of the solution in the context of the original situation.'),(432,'/ca/1997/math/standard/grade-6',370,'6.MR.3.2','Note the method of deriving the solution and demonstrate a conceptual understanding of the derivation by solving similar problems.'),(433,'/ca/1997/math/standard/grade-6',370,'6.MR.3.3','Develop generalizations of the results obtained and the strategies used and apply them in new problem situations.'),(434,'/ca/1997/math/standard/grade-7',43,'1997 California Content Standards (Grade-7)',NULL),(435,'/ca/1997/math/standard/grade-7',434,'7.NS.1.0','Students know the properties of, and compute with, rational numbers expressed in a variety of forms:'),(436,'/ca/1997/math/standard/grade-7',434,'7.NS.1.1','Read, write, and compare rational numbers in scientific notation (positive and negative powers of 10) with approximate numbers using scientific notation.'),(437,'/ca/1997/math/standard/grade-7',434,'7.NS.1.2','Add, subtract, multiply, and divide rational numbers (integers, fractions, and terminating decimals) and take positive rational numbers to whole-number powers.'),(438,'/ca/1997/math/standard/grade-7',434,'7.NS.1.3','Convert fractions to decimals and percents and use these representations in estimations, computations, and applications.'),(439,'/ca/1997/math/standard/grade-7',434,'7.NS.1.4','Differentiate between rational and irrational numbers.'),(440,'/ca/1997/math/standard/grade-7',434,'7.NS.1.5','Know that every rational number is either a terminating or repeating decimal and be able to convert terminating decimals into reduced fractions.'),(441,'/ca/1997/math/standard/grade-7',434,'7.NS.1.6','Calculate the percentage of increases and decreases of a quantity.'),(442,'/ca/1997/math/standard/grade-7',434,'7.NS.1.7','Solve problems that involve discounts, markups, commissions, and profit and compute simple and compound interest.'),(443,'/ca/1997/math/standard/grade-7',434,'7.NS.2.0','Students use exponents, powers, and roots and use exponents in working with fractions:'),(444,'/ca/1997/math/standard/grade-7',434,'7.NS.2.1','Understand negative whole-number exponents. Multiply and divide expressions involving exponents with a common base.'),(445,'/ca/1997/math/standard/grade-7',434,'7.NS.2.2','Add and subtract fractions by using factoring to find common denominators.'),(446,'/ca/1997/math/standard/grade-7',434,'7.NS.2.3','Multiply, divide, and simplify rational numbers by using exponent rules.'),(447,'/ca/1997/math/standard/grade-7',434,'7.NS.2.4','Use the inverse relationship between raising to a power and extracting the root of a perfect square integer; for an integer that is not square, determine without a calculator the two integers between which its square root lies and explain why.'),(448,'/ca/1997/math/standard/grade-7',434,'7.NS.2.5','Understand the meaning of the absolute value of a number; interpret the absolute value as the distance of the number from zero on a number line; and determine the absolute value of real numbers.'),(449,'/ca/1997/math/standard/grade-7',434,'7.AF.1.0','Students express quantitative relationships by using algebraic terminology, expressions, equations, inequalities, and graphs:'),(450,'/ca/1997/math/standard/grade-7',434,'7.AF.1.1','Use variables and appropriate operations to write an expression, an equation, an inequality, or a system of equations or inequalities that represents a verbal description (e.g., three less than a number, half as large as area A).'),(451,'/ca/1997/math/standard/grade-7',434,'7.AF.1.2','Use the correct order of operations to evaluate algebraic expressions such as 3(2x + 5)?.'),(452,'/ca/1997/math/standard/grade-7',434,'7.AF.1.3','Simplify numerical expressions by applying properties of rational numbers (e.g., identity, inverse, distributive, associative, commutative) and justify the process used.'),(453,'/ca/1997/math/standard/grade-7',434,'7.AF.1.4','Use algebraic terminology (e.g., variable, equation, term, coefficient, inequality, expression, constant) correctly.'),(454,'/ca/1997/math/standard/grade-7',434,'7.AF.1.5','Represent quantitative relationships graphically and interpret the meaning of a specific part of a graph in the situation represented by the graph.'),(455,'/ca/1997/math/standard/grade-7',434,'7.AF.2.0','Students interpret and evaluate expressions involving integer powers and simple roots:'),(456,'/ca/1997/math/standard/grade-7',434,'7.AF.2.1','Interpret positive whole-number powers as repeated multiplication and negative whole-number powers as repeated division or multiplication by the multiplicative inverse. Simplify and evaluate expressions that include exponents.'),(457,'/ca/1997/math/standard/grade-7',434,'7.AF.2.2','Multiply and divide monomials; extend the process of taking powers and extracting roots to monomials when the latter results in a monomial with an integer exponent.'),(458,'/ca/1997/math/standard/grade-7',434,'7.AF.3.0','Students graph and interpret linear and some nonlinear functions:'),(459,'/ca/1997/math/standard/grade-7',434,'7.AF.3.1','Graph functions of the form y = nx<sup>2</sup> and y = nx<sup>3</sup> and use in solving problems.'),(460,'/ca/1997/math/standard/grade-7',434,'7.AF.3.2','Plot the values from the volumes of three-dimensional shapes for various values of the edge lengths (e.g., cubes with varying edge lengths or a triangle prism with a fixed height and an equilateral triangle base of varying lengths).'),(461,'/ca/1997/math/standard/grade-7',434,'7.AF.3.3','Graph linear functions, noting that the vertical change (change in y-value) per unit of horizontal change (change in x-value) is always the same and know that the ratio (\"rise over run\") is called the slope of a graph.'),(462,'/ca/1997/math/standard/grade-7',434,'7.AF.3.4','Plot the values of quantities whose ratios are always the same (e.g., cost to the number of an item, feet to inches, circumference to diameter of a circle). Fit a line to the plot and understand that the slope of the line equals the quantities.'),(463,'/ca/1997/math/standard/grade-7',434,'7.AF.4.0','Students solve simple linear equations and inequalities over the rational numbers:'),(464,'/ca/1997/math/standard/grade-7',434,'7.AF.4.1','Solve two-step linear equations and inequalities in one variable over the rational numbers, interpret the solution or solutions in the context from which they arose, and verify the reasonableness of the results.'),(465,'/ca/1997/math/standard/grade-7',434,'7.AF.4.2','Solve multistep problems involving rate, average speed, distance, and time or a direct variation.'),(466,'/ca/1997/math/standard/grade-7',434,'7.MG.1.0','Students choose appropriate units of measure and use ratios to convert within and between measurement systems to solve problems:'),(467,'/ca/1997/math/standard/grade-7',434,'7.MG.1.1','Compare weights, capacities, geometric measures, times, and temperatures within and between measurement systems (e.g., miles per hour and feet per second, cubic inches to cubic centimeters).'),(468,'/ca/1997/math/standard/grade-7',434,'7.MG.1.2','Construct and read drawings and models made to scale.'),(469,'/ca/1997/math/standard/grade-7',434,'7.MG.1.3','Use measures expressed as rates (e.g., speed, density) and measures expressed as products (e.g., person-days) to solve problems; check the units of the solutions; and use dimensional analysis to check the reasonableness of the answer.'),(470,'/ca/1997/math/standard/grade-7',434,'7.MG.2.0','Students compute the perimeter, area, and volume of common geometric objects and use the results to find measures of less common objects. They know how perimeter, area, and volume are affected by changes of scale:'),(471,'/ca/1997/math/standard/grade-7',434,'7.MG.2.1','Use formulas routinely for finding the perimeter and area of basic two-dimensional figures and the surface area and volume of basic three-dimensional figures, including rectangles, parallelograms, trapezoids, squares, triangles, circles, prisms, and cylinders.'),(472,'/ca/1997/math/standard/grade-7',434,'7.MG.2.2','Estimate and compute the area of more complex or irregular two- and three-dimensional figures by breaking the figures down into more basic geometric objects.'),(473,'/ca/1997/math/standard/grade-7',434,'7.MG.2.3','Compute the length of the perimeter, the surface area of the faces, and the volume of a three-dimensional object built from rectangular solids. Understand that when the lengths of all dimensions are multiplied by a scale factor, the surface area is multiplied by the square of the scale factor and the volume is multiplied by the cube of the scale factor.'),(474,'/ca/1997/math/standard/grade-7',434,'7.MG.2.4','Relate the changes in measurement with a change of scale to the units used (e.g., square inches, cubic feet) and to conversions between units (1 square foot = 144 square inches or [1 ft?] = [144 in?], 1 cubic inch is approximately 16.38 cubic centimeters or [1 in?] = [16.38 cm?]).'),(475,'/ca/1997/math/standard/grade-7',434,'7.MG.3.0','Students know the Pythagorean theorem and deepen their understanding of plane and solid geometric shapes by constructing figures that meet given conditions and by identifying attributes of figures:'),(476,'/ca/1997/math/standard/grade-7',434,'7.MG.3.1','Identify and construct basic elements of geometric figures (e.g., altitudes, mid-points, diagonals, angle bisectors, and perpendicular bisectors; central angles, radii, diameters, and chords of circles) by using a compass and straightedge.'),(477,'/ca/1997/math/standard/grade-7',434,'7.MG.3.2','Understand and use coordinate graphs to plot simple figures, determine lengths and areas related to them, and determine their image under translations and reflections.'),(478,'/ca/1997/math/standard/grade-7',434,'7.MG.3.3','Know and understand the Pythagorean theorem and its converse and use it to find the length of the missing side of a right triangle and the lengths of other line segments and, in some situations, empirically verify the Pythagorean theorem by direct measurement.'),(479,'/ca/1997/math/standard/grade-7',434,'7.MG.3.4','Demonstrate an understanding of conditions that indicate two geometrical figures are congruent and what congruence means about the relationships between the sides and angles of the two figures.'),(480,'/ca/1997/math/standard/grade-7',434,'7.MG.3.5','Construct two-dimensional patterns for three-dimensional models, such as cylinders, prisms, and cones.'),(481,'/ca/1997/math/standard/grade-7',434,'7.MG.3.6','Identify elements of three-dimensional geometric objects (e.g., diagonals of rectangular solids) and describe how two or more objects are related in space (e.g., skew lines, the possible ways three planes might intersect).'),(482,'/ca/1997/math/standard/grade-7',434,'7.SDAP.1.0','Students collect, organize, and represent data sets that have one or more variables and identify relationships among variables within a data set by hand and through the use of an electronic spreadsheet software program:'),(483,'/ca/1997/math/standard/grade-7',434,'7.SDAP.1.1','Know various forms of display for data sets, including a stem-and-leaf plot or box-and-whisker plot; use the forms to display a single set of data or to compare two sets of data.'),(484,'/ca/1997/math/standard/grade-7',434,'7.SDAP.1.2','Represent two numerical variables on a scatterplot and informally describe how the data points are distributed and any apparent relationship that exists between the two variables (e.g., between time spent on homework and grade level).'),(485,'/ca/1997/math/standard/grade-7',434,'7.SDAP.1.3','Understand the meaning of, and be able to compute, the minimum, the lower quartile, the median, the upper quartile, and the maximum of a data set.'),(486,'/ca/1997/math/standard/grade-7',434,'7.MR.1.0','Students make decisions about how to approach problems:'),(487,'/ca/1997/math/standard/grade-7',434,'7.MR.1.1','Analyze problems by identifying relationships, distinguishing relevant from irrelevant information, identifying missing information, sequencing and prioritizing information, and observing patterns.'),(488,'/ca/1997/math/standard/grade-7',434,'7.MR.1.2','Formulate and justify mathematical conjectures based on a general description of the mathematical question or problem posed.'),(489,'/ca/1997/math/standard/grade-7',434,'7.MR.1.3','Determine when and how to break a problem into simpler parts.'),(490,'/ca/1997/math/standard/grade-7',434,'7.MR.2.0','Students use strategies, skills, and concepts in finding solutions:'),(491,'/ca/1997/math/standard/grade-7',434,'7.MR.2.1','Use estimation to verify the reasonableness of calculated results.'),(492,'/ca/1997/math/standard/grade-7',434,'7.MR.2.2','Apply strategies and results from simpler problems to more complex problems.'),(493,'/ca/1997/math/standard/grade-7',434,'7.MR.2.3','Estimate unknown quantities graphically and solve for them by using logical reasoning and arithmetic and algebraic techniques.'),(494,'/ca/1997/math/standard/grade-7',434,'7.MR.2.4','Make and test conjectures by using both inductive and deductive reasoning.'),(495,'/ca/1997/math/standard/grade-7',434,'7.MR.2.5','Use a variety of methods, such as words, numbers, symbols, charts, graphs, tables, diagrams, and models, to explain mathematical reasoning.'),(496,'/ca/1997/math/standard/grade-7',434,'7.MR.2.6','Express the solution clearly and logically by using the appropriate mathematical notation and terms and clear language; support solutions with evidence in both verbal and symbolic work.'),(497,'/ca/1997/math/standard/grade-7',434,'7.MR.2.7','Indicate the relative advantages of exact and approximate solutions to problems and give answers to a specified degree of accuracy.'),(498,'/ca/1997/math/standard/grade-7',434,'7.MR.2.8','Make precise calculations and check the validity of the results from the context of the problem.'),(499,'/ca/1997/math/standard/grade-7',434,'7.MR.3.0','Students determine a solution is complete and move beyond a particular problem by generalizing to other situations:'),(500,'/ca/1997/math/standard/grade-7',434,'7.MR.3.1','Evaluate the reasonableness of the solution in the context of the original situation.'),(501,'/ca/1997/math/standard/grade-7',434,'7.MR.3.2','Note the method of deriving the solution and demonstrate a conceptual understanding of the derivation by solving similar problems.'),(502,'/ca/1997/math/standard/grade-7',434,'7.MR.3.3','Develop generalizations of the results obtained and the strategies used and apply them to new problem situations.'),(503,'/ca/1997/math/standard/ai',43,'1997 California Content Standards (AI)',NULL),(504,'/ca/1997/math/standard/ai',503,'AI.1','Students identify and use the arithmetic properties of subsets of integers and rational, irrational, and real numbers, including closure properties for the four basic arithmetic operations where applicable:'),(505,'/ca/1997/math/standard/ai',503,'AI.1.1','Students use properties of numbers to demonstrate whether assertions are true or false.'),(506,'/ca/1997/math/standard/ai',503,'AI.2.0','Students understand and use such operations as taking the opposite, finding the reciprocal, taking a root, and raising to a fractional power. They understand and use the rules of exponents.'),(507,'/ca/1997/math/standard/ai',503,'AI.3.0','Students solve equations and inequalities involving absolute values.'),(508,'/ca/1997/math/standard/ai',503,'AI.4.0','Students simplify expressions before solving linear equations and inequalities in one variable, such as 3(2x - 5) + 4(x - 2) = 12.'),(509,'/ca/1997/math/standard/ai',503,'AI.5.0','Students solve multistep problems, including word problems, involving linear equations and linear inequalities in one variable and provide justification for each step.'),(510,'/ca/1997/math/standard/ai',503,'AI.6.0','Students graph a linear equation and compute the x-and y-intercepts (e.g., graph 2x + 6y = 4). They are also able to sketch the region defined by linear inequality (e.g., they sketch the region defined by 2x + 6y < 4).'),(511,'/ca/1997/math/standard/ai',503,'AI.7.0','Students verify that a point lies on a line, given an equation of the line. Students are able to derive linear equations by using the point-slope formula.'),(512,'/ca/1997/math/standard/ai',503,'AI.8.0','Students understand the concepts of parallel lines and perpendicular lines and how those slopes are related. Students are able to find the equation of a line perpendicular to a given line that passes through a given point.'),(513,'/ca/1997/math/standard/ai',503,'AI.9.0','Students solve a system of two linear equations in two variables algebraically and are able to interpret the answer graphically. Students are able to solve a system of two linear inequalities in two variables and to sketch the solution sets.'),(514,'/ca/1997/math/standard/ai',503,'AI.10.0','Students add, subtract, multiply, and divide monomials and polynomials. Students solve multistep problems, including word problems, by using these techniques.'),(515,'/ca/1997/math/standard/ai',503,'AI.11.0','Students apply basic factoring techniques to second- and simple third-degree polynomials. These techniques include finding a common factor for all terms in a polynomial, recognizing the difference of two squares, and recognizing perfect squares of binomials.'),(516,'/ca/1997/math/standard/ai',503,'AI.12.0','Students simplify fractions with polynomials in the numerator and denominator by factoring both and reducing them to the lowest terms.'),(517,'/ca/1997/math/standard/ai',503,'AI.13.0','Students add, subtract, multiply, and divide rational expressions and functions. Students solve both computationally and conceptually challenging problems by using these techniques.'),(518,'/ca/1997/math/standard/ai',503,'AI.14.0','Students solve a quadratic equation by factoring or completing the square.'),(519,'/ca/1997/math/standard/ai',503,'AI.15.0','Students apply algebraic techniques to solve rate problems, work problems, and percent mixture problems.'),(520,'/ca/1997/math/standard/ai',503,'AI.16.0','Students understand the concepts of a relation and a function, determine whether a given relation defines a function, and give pertinent information about given relations and functions.'),(521,'/ca/1997/math/standard/ai',503,'AI.17.0','Students determine the domain of independent variables and the range of dependent variables defined by a graph, a set of ordered pairs, or a symbolic expression.'),(522,'/ca/1997/math/standard/ai',503,'AI.18.0','Students determine whether a relation defined by a graph, a set of ordered pairs, or a symbolic expression is a function and justify the conclusion.'),(523,'/ca/1997/math/standard/ai',503,'AI.19.0','Students know the quadratic formula and are familiar with its proof by completing the square.'),(524,'/ca/1997/math/standard/ai',503,'AI.20.0','Students use the quadratic formula to find the roots of a second-degree polynomial and to solve quadratic equations.'),(525,'/ca/1997/math/standard/ai',503,'AI.21.0','Students graph quadratic functions and know that their roots are the x-intercepts.'),(526,'/ca/1997/math/standard/ai',503,'AI.22.0','Students use the quadratic formula or factoring techniques or both to determine whether the graph of a quadratic function will intersect the x-axis in zero, one, or two points.'),(527,'/ca/1997/math/standard/ai',503,'AI.23.0','Students apply quadratic equations to physical problems, such as the motion of an object under the force of gravity.'),(528,'/ca/1997/math/standard/ai',503,'AI.24.0','Students use and know simple aspects of a logical argument:'),(529,'/ca/1997/math/standard/ai',503,'AI.24.1','Students explain the difference between inductive and deductive reasoning and identify and provide examples of each.'),(530,'/ca/1997/math/standard/ai',503,'AI.24.2','Students identify the hypothesis and conclusion in logical deduction.'),(531,'/ca/1997/math/standard/ai',503,'AI.24.3','Students use counterexamples to show that an assertion is false and recognize that a single counterexample is sufficient to refute an assertion.'),(532,'/ca/1997/math/standard/ai',503,'AI.25.0','Students use properties of the number system to judge the validity of results, to justify each step of a procedure, and to prove or disprove statements:'),(533,'/ca/1997/math/standard/ai',503,'AI.25.1','Students use properties of numbers to construct simple, valid arguments (direct and indirect) for, or formulate counterexamples to, claimed assertions.'),(534,'/ca/1997/math/standard/ai',503,'AI.25.2','Students judge the validity of an argument according to whether the properties of the real number system and the order of operations have been applied correctly at each step.'),(535,'/ca/1997/math/standard/ai',503,'AI.25.3','Given a specific algebraic statement involving linear, quadratic, or absolute value expressions or equations or inequalities, students determine whether the statement is true sometimes, always, or never.'),(536,'/ca/1997/math/glossary',0,'Glossary',NULL),(537,'/ca/1997/math/glossary',536,'absolute value','A number\'s distance from zero on the number line. The absolute value of -4 is 4; the absolute value of 4 is 4.'),(538,'/ca/1997/math/glossary',536,'algorithm','An organized procedure for performing a given type of calculation or solving a given type of problem. An example is long division.'),(539,'/ca/1997/math/glossary',536,'arithmetic sequence','A sequence of elements, a1 , a2 , a3 , . . ., such that the difference of successive terms is a constant ai+1 - ai = k ; for example, the sequence {2, 5, 8, 11, 14, . . .} where the common difference is 3.'),(540,'/ca/1997/math/glossary',536,'asymptotes','Straight lines that have the property of becoming and staying arbitrarily close to the curve as the distance from the origin increases to infinity. For example, the x- axis is the only asymptote to the graph of sin( x)/x.'),(541,'/ca/1997/math/glossary',536,'axiom','A basic assumption about a mathematical system from which theorems can be deduced. For example, the system could be the points and lines in the plane. Then an axiom would be that given any two distinct points in the plane, there is a unique line through them.'),(542,'/ca/1997/math/glossary',536,'binomial','In algebra, an expression consisting of the sum or difference of two monomials (see the definition of monomial), such as 4a-8b.'),(543,'/ca/1997/math/glossary',536,'binomial distribution','In probability, a binomial distribution gives the probabilities of k outcomes A (or n-k outcomes B) in n independent trials for a two-outcome experiment in which the possible outcomes are denoted A and B.'),(544,'/ca/1997/math/glossary',536,'binomial theorem','In mathematics, a theorem that specifies the complete expansion of a binomial raised to any positive integer power.'),(545,'/ca/1997/math/glossary',536,'box-and-whisker plot','A graphical method for showing the median, quartiles, and extremes of data. A box plot shows where the data are spread out and where they are concentrated.'),(546,'/ca/1997/math/glossary',536,'complex numbers','Numbers that have the form a + bi where a and b are real numbers and i satisfies the equation i2 = -1. Multiplication is denoted by ( a + bi )( c + di ) = ( ac - bd ) + ( ad + bc ) i , and addition is denoted by ( a + bi ) + ( c + di ) = ( a + c ) + ( b + d ) i .'),(547,'/ca/1997/math/glossary',536,'congruent','Two shapes in the plane or in space are congruent if there is a rigid motion that identifies one with the other (see the definition of rigid motion).'),(548,'/ca/1997/math/glossary',536,'conjecture','An educated guess.'),(549,'/ca/1997/math/glossary',536,'coordinate system','A rule of correspondence by which two or more quantities locate points unambiguously and which satisfies the further property that points unambiguously determine the quantities; for example, the usual Cartesian coordinates x, y in the plane.'),(550,'/ca/1997/math/glossary',536,'cosine','Cos(q) is the x- coordinate of the point on the unit circle so that the ray connecting the point with the origin makes an angle of q with the positive x- axis. When q is an angle of a right triangle, then cos(q) is the ratio of the adjacent side with the hypotenuse.'),(551,'/ca/1997/math/glossary',536,'dilation','In geometry, a transformation D of the plane or space is a dilation at a point P if it takes P to itself, preserves angles, multiplies distances from P by a positive real number r, and takes every ray through P onto itself. In case P is the origin for a Cartesian coordinate system in the plane, then the dilation D maps the point ( x, y ) to the point ( rx, ry ).'),(552,'/ca/1997/math/glossary',536,'dimensional analysis','A method of manipulating unit measures algebraically to determine the proper units for a quantity computed algebraically. For example, velocity has units of the form length over time (e.g., meters per second [ m/sec ]), and acceleration has units of velocity over time; so it follows that acceleration has units ( m/sec)/sec = m/(sec2).'),(553,'/ca/1997/math/glossary',536,'expanded form','The expanded form of an algebraic expression is the equivalent expression without parentheses. For example, the expanded form of ( a + b )2 is a2 + 2ab + b2 .'),(554,'/ca/1997/math/glossary',536,'exponent','The power to which a number or variable is raised (the exponent may be any real number).'),(555,'/ca/1997/math/glossary',536,'exponential function','A function commonly used to study growth and decay. It has the form y = ax with a positive.'),(556,'/ca/1997/math/glossary',536,'factors','Any of two or more quantities that are multiplied together. In the expression 3.712 x 11.315, the factors are 3.712 and 11.315.'),(557,'/ca/1997/math/glossary',536,'function','A correspondence in which values of one variable determine the values of another.'),(558,'/ca/1997/math/glossary',536,'geometric sequence','A sequence in which there is a common ratio between successive terms. Each successive term of a geometric sequence is found by multiplying the preceding term by the common ratio. For example, in the sequence {1, 3, 9, 27, 81, . . .} the common ratio is 3.'),(559,'/ca/1997/math/glossary',536,'histogram','A vertical block graph with no spaces between the blocks. It is used to represent frequency data in statistics.'),(560,'/ca/1997/math/glossary',536,'inequality','A relationship between two quantities indicating that one is strictly less than or less than or equal to the other.'),(561,'/ca/1997/math/glossary',536,'integers','The set consisting of the positive and negative whole numbers and zero; for example, {. . . -2, -1, 0, 1, 2 . . .}.'),(562,'/ca/1997/math/glossary',536,'irrational number','A number that cannot be represented as an exact ratio of two integers. For example, the square root of 2 or p .'),(563,'/ca/1997/math/glossary',536,'linear expression','An expression of the form ax+b where x is variable and a and b are constants; or in more variables, an expression of the form ax + by + c, ax + by + cz + d, etc.'),(564,'/ca/1997/math/glossary',536,'linear equation','An equation containing linear expressions.'),(565,'/ca/1997/math/glossary',536,'logarithm','The inverse of exponentiation; for example, alogax = x.'),(566,'/ca/1997/math/glossary',536,'mean','In statistics, the average obtained by dividing the sum of two or more quantities by the number of these quantities.'),(567,'/ca/1997/math/glossary',536,'median','In statistics, the quantity designating the middle value in a set of numbers.'),(568,'/ca/1997/math/glossary',536,'mode','In statistics, the value that occurs most frequently in a given series of numbers.'),(569,'/ca/1997/math/glossary',536,'monomial','In the variables x, y, z, a monomial is an expression of the form axm yn zk , in which m, n, and k are nonnegative integers and a is a constant (e.g., 5x2 , 3x2 y or 7x3yz2 ).'),(570,'/ca/1997/math/glossary',536,'nonstandard unit','Unit of measurement expressed in terms of objects (such as paper clips, sticks of gum, shoes, etc.).'),(571,'/ca/1997/math/glossary',536,'parallel','Given distinct lines in the plane that are infinite in both directions, the lines are parallel if they never meet. Two distinct lines in the coordinate plane are parallel if and only if they have the same slope.'),(572,'/ca/1997/math/glossary',536,'permutation','A permutation of the set of numbers {1, 2, . . . , n } is a reordering of these numbers.'),(573,'/ca/1997/math/glossary',536,'polar coordinates','The coordinate system for the plane based on r , q , the distance from the origin and q , and the angle between the positive x- axis and the ray from the origin to the point.'),(574,'/ca/1997/math/glossary',536,'polar equation','Any relation between the polar coordinates (r, q ) of a set of points (e.g., r = 2cosq is the polar equation of a circle).'),(575,'/ca/1997/math/glossary',536,'polynomial','In algebra, a sum of monomials; for example, x2 + 2xy + y2 .'),(576,'/ca/1997/math/glossary',536,'prime','A natural number p greater than 1 is prime if and only if the only positive integer factors of p are 1 and p. The first seven primes are 2, 3, 5, 7, 11, 13, 17.'),(577,'/ca/1997/math/glossary',536,'quadratic function','A function given by a polynomial of degree 2.'),(578,'/ca/1997/math/glossary',536,'random variable','A function on a probability space.'),(579,'/ca/1997/math/glossary',536,'range','In statistics, the difference between the greatest and smallest values in a data set. In mathematics, the image of a function.'),(580,'/ca/1997/math/glossary',536,'ratio','A comparison expressed as a fraction. For example, there is a ratio of three boys to two girls in a class (3/2, 3:2).'),(581,'/ca/1997/math/glossary',536,'rational numbers','Numbers that can be expressed as the quotient of two integers; for example, 7/3, 5/11, -5/13, 7 = 7/1.'),(582,'/ca/1997/math/glossary',536,'real numbers','All rational and irrational numbers.'),(583,'/ca/1997/math/glossary',536,'reflection','The reflection through a line in the plane or a plane in space is the transformation that takes each point in the plane to its mirror image with respect to the line or its mirror image with respect to the plane in space. It produces a mirror image of a geometric figure.'),(584,'/ca/1997/math/glossary',536,'rigid motion','A transformation of the plane or space, which preserves distance and angles.'),(585,'/ca/1997/math/glossary',536,'root extraction','Finding a number that can be used as a factor a given number of times to produce the original number; for example, the fifth root of 32 = 2 because 2 x 2 x 2 x 2 x 2 = 32).'),(586,'/ca/1997/math/glossary',536,'rotation','A rotation in the plane through an angle q and about a point P is a rigid motion T fixing P so that if Q is distinct from P, then the angle between the lines PQ and PT(Q) is always q . A rotation through an angle q in space is a rigid motion T fixing the points of a line l so that it is a rotation through q in the plane perpendicular to l through some point on l.'),(587,'/ca/1997/math/glossary',536,'scalar matrix','A matrix whose diagonal elements are all equal while the non diagonal elements are all 0. The identity matrix is an example.'),(588,'/ca/1997/math/glossary',536,'scatterplot','A graph of the points representing a collection of data.'),(589,'/ca/1997/math/glossary',536,'scientific notation','A shorthand way of writing very large or very small numbers. A number expressed in scientific notation is expressed as a decimal number between 1 and 10 multiplied by a power of 10 (e.g., 7000 = 7 x 103 or 0.0000019 = 1.9 x 10-6 ).'),(590,'/ca/1997/math/glossary',536,'similarity','In geometry, two shapes R and S are similar if there is a dilation D (see the definition of dilation) that takes S to a shape congruent to R. It follows that R and S are similar if they are congruent after one of them is expanded or shrunk.'),(591,'/ca/1997/math/glossary',536,'sine','Sin(q) is the y- coordinate of the point on the unit circle so that the ray connecting the point with the origin makes an angle of q with the positive x- axis. When q is an angle of a right triangle, then sin(q) is the ratio of the opposite side with the hypotenuse.'),(592,'/ca/1997/math/glossary',536,'square root','The square roots of n are all the numbers m so that m2 = n. The square roots of 16 are 4 and -4. The square roots of -16 are 4 i and -4 i .'),(593,'/ca/1997/math/glossary',536,'standard deviation','A statistic that measures the dispersion of a sample.'),(594,'/ca/1997/math/glossary',536,'symmetry','A symmetry of a shape S in the plane or space is a rigid motion T that takes S onto itself (T(S) = S). For example, reflection through a diagonal and a rotation through a right angle about the center are both symmetries of the square.'),(595,'/ca/1997/math/glossary',536,'system of linear equations','Set of equations of the first degree (e.g., x + y = 7 and x - y = 1 ). A solution of a set of linear equations is a set of numbers a, b, c, . . . so that when the variables are replaced by the numbers all the equations are satisfied. For example, in the equations above, x = 4 and y = 3 is a solution.'),(596,'/ca/1997/math/glossary',536,'translation','A rigid motion of the plane or space of the form X goes to X + V for a fixed vector V.'),(597,'/ca/1997/math/glossary',536,'transversal','In geometry, given two or more lines in the plane a transversal is a line distinct from the original lines and intersects each of the given lines in a single point.'),(598,'/ca/1997/math/glossary',536,'unit fraction','A fraction whose numerator is 1 (e.g., 1/ p , 1/3, 1/x). Every nonzero number may be written as a unit fraction since, for n not equal to 0, n = 1/(1/ n ).'),(599,'/ca/1997/math/glossary',536,'variable','A placeholder in algebraic expressions; for example, in 3x + y = 23, x and y are variables.'),(600,'/ca/1997/math/glossary',536,'vector','Quantity that has magnitude (length) and direction. It may be represented as a directed line segment.'),(601,'/ca/1997/math/glossary',536,'zeros of a function','The points at which the value of a function is zero.');
