CREATE TABLE `TST_TEST` (
  `TST_ID` int(11) NOT NULL,
  `TST_BUNDLE_ID` int(11) NOT NULL,
  `TST_OWNER_USR_ID` int(11) NOT NULL,
  `TST_STARTED_ON` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `TST_UPDATED_ON` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `TST_VARIATION_IDS` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL,
  `TST_ANSWER_INDEXES` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL,
  `TST_SCORE_SHEET` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL,
  `TST_ATTEMPTED` int(11) DEFAULT NULL,
  `TST_COMPLETED` int(11) DEFAULT NULL,
  `TST_CORRECT` int(11) DEFAULT NULL,
  `TST_INCORRECT` int(11) DEFAULT NULL,
  `TST_STATE` tinyint(4) NOT NULL,
  UNIQUE KEY `idxID` (`TST_ID`),
  KEY `idxBUNDLE` (`TST_BUNDLE_ID`),
  KEY `idxOWNER` (`TST_OWNER_USR_ID`),
  KEY `idxSTATE` (`TST_STATE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
